INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES (431,'elementor_remote_info_feed_data','a:5:{i:0;a:5:{s:5:\"title\";s:34:\"Complete Guide to WordPress Themes\";s:7:\"excerpt\";s:233:\"If you\'re using WordPress, you need to understand the concept of WordPress themes. Themes are an essential part of your website and you won\'t be able to get the most from WordPress if you don\'t know what themes are and how they work.\";s:7:\"created\";i:1598529207;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/wordpress-themes/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:67:\"Is WordPress Hard to Use? Sometimes, But It\'s Worth It (Here\'s Why)\";s:7:\"excerpt\";s:267:\"Along with the challenges of working with WordPress, there are many benefits that make it the leading platform for web creators. In this post, we discuss both sides and share some strategies that will help you make it easier to create awesome websites with WordPress.\";s:7:\"created\";i:1597914309;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/is-wordpress-hard-to-use/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:60:\"Monthly Template Kits #40: The Flooring Website Template Kit\";s:7:\"excerpt\";s:223:\"This month‚Äôs template kit is for flooring companies looking to build a sophisticated, attractive website, which can also be used by other business-types, such as spa websites, medical clinics, law offices, and many more. \";s:7:\"created\";i:1597824062;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:129:\"https://elementor.com/blog/flooring-website-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:75:\"WordPress Themes vs. WordPress Template Kits ‚Äî Explaining the Differences\";s:7:\"excerpt\";s:275:\"In this post, we will evaluate the differences between WordPress themes, WordPress templates, and Elementor Template Kits. This understanding will equip web creators with the complete understanding of the multiple resources available to them for their website design process.\";s:7:\"created\";i:1597759535;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:127:\"https://elementor.com/blog/wordpress-theme-vs-template/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:99:\"How to Streamline Your Freelance Business Processes ‚Äî Takeaways From Our Webinar With Paul Jarvis\";s:7:\"excerpt\";s:217:\"Paul Jarvis, a web designer, podcaster, and author of \"Company of One\", provides illuminating insights on how to streamline your freelance business processes, with an in-depth explanation of why it\'s crucial to do so.\";s:7:\"created\";i:1597652002;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/webinar-paul-jarvis/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','no');
